import React,{ useEffect, useState } from "react";
import axios from "axios";

const Tl = () => {
    const [nhansus, setNhansus] = useState([])
    useEffect(() =>{
        axios.get('http://localhost:3000/nhansu')
        .then(Response => {if(Response.data) {setNhansus(Response.data);} else { alert(Response.data)}}).catch(err => console.log(err))}, []);

    return (
        <div>
            <h1>TÍNH LƯƠNG</h1>
            <table className='table'>
                <thead>
                    <tr>
                        <th>Mã Nhân Viên</th>
                        <th>Tên</th>
                        <th>Chức Vụ</th>
                        <th>Quyền Hạng</th>
                        <th>Tùy Chọn</th>

                    </tr>
                </thead>
                <tbody>
                    {
                        nhansus.map(e => {
                            <tr >
                                <td>{e.Mnv}</td>
                                <td>{e.Hoten}</td>
                                <td>{e.Chucvu}</td>
                                <td>{e.Quyenhang}</td>
                                <td className='td-tuychon'>
                                    <button className='bt-chamlai'>Tính Lương</button>
                                    <button className='bt-chamlai'>Tính Lại</button>
                                </td>
                            </tr>
                        })
                    }
                </tbody>
            </table>
        </div>
    );
}

export default Tl;
